import React, { Component } from 'react';
import './styles.css'


class Driver extends Component {
    render() {
        return(
            <div className="container-form">
                <h1 className="form-title">Registro de conductor</h1>
                <form className="form-info">
                    <input className="field" id="name" type="text" placeholder="Nombre completo"/>
                    <input className="field" id="email" type="email" placeholder="Correo electrónico"/>
                    <input className="field" id="cellphone" type="text" placeholder="Celular"/>
                    <input className="field" id="address" type="text" placeholder="Dirección"/>
                </form>
                <button className="">Enviar</button>
            </div>  
        );
    }
}

export default Driver;
